import React, {useState, useRef, useEffect} from "react";
import { useDispatch, useSelector } from "react-redux";

import {selectIsLoggedIn} from "../../slice/authSlice";

import Navbar from '../sub/Navbar';

import '../../styles/main/Order.css';

const Orders = () => {

    const loggedIn = useSelector(selectIsLoggedIn);
    if (!loggedIn) console.log('redirect to login'); //return <Redirect to="/login" />;

    return (
        <div className="center_container">
            <Navbar />
            <div className="main_content">
                <div className="main_outer_content"></div>
                <div className="main_center_content"></div>
                <div className="main_outer_content"></div>
            </div>
        </div>
    );
};

export default Orders;
